DESCRIPTION
2-Disc Set. Fire has never been so hot since these sexy firefighters took over the station. Dangerous explosions, life or death situations, and powerful desire makes everyone live for the moment. For the first time ever, Digital Playground contract stars Jesse Jane and Kayden Kross sizzle together as a dynamic duo burning up the screen with scorching passion. Riley Steele, Raven Alexis and Katsuni help fuel the flames in an epic orgy atop a fire engine that will make your temperature soar. Male studs Scott Nails, Manuel Ferrara, Evan Stone, and Tommy Gunn ignite the action in this to-die-for movie. Playing with fire never hurt so good.
